import React from 'react';
import styled from 'styled-components';
import { HomeTopbannerDummydata } from 'utils/mockData';
import TopBanner from '../../components/common/TopBanner';

function HomePage() {
	return (
		<ComponentsWrapper>
			<TopBanner data={HomeTopbannerDummydata} />
			<section className="section">
				<div className="box-section-wrapper">
					<div className="box-title">
						<div className="title-wrapper">
							<h2 className="title-content">
								나에게 필요한 커리어 인사이트
							</h2>
						</div>
					</div>
				</div>
			</section>
		</ComponentsWrapper>
	);
}

const ComponentsWrapper = styled.div`
	padding-top: 25px;

	.section {
		position: relative;
		scroll-margin-top: 4px;
		padding: 60px 0;
	}
	.box-section-wrapper {
		max-width: 1060px;
		width: 87.72%;
		/* width: 1060px; */
		margin: 0 auto;
	}
	.box-title {
		text-align: center;
	}
	.title-wrapper {
		display: flex;
		align-items: center;
		justify-content: center;
	}
	.title-content{
    font-size: 22px;
    font-size: 18px;
    line-height: 1.33;
    font-weight: 700;
    color: #333;
    margin-left: 4px;
    line-height: normal;
}
	}
`;

export default HomePage;
